import React from 'react';
import logo from './logo.svg';
import './App.css';
import Greet from './Components/Greet';
import Welcome from './Components/Welcome';

function App() {
  return (
    <div className="App">
      props = Greet({name='hima'})
      <props/>
      <Welcome/>;
    </div>
  );
}

export default App;
